var tipuesearch = {"pages": [{'title': 'About', 'text': '第一組 組員 \n 40923113 王柏竣 \n 40923130 林祐詮 \n 40923140 徐詠鈞 \n 40923144 高偉倫 \n 40923145 張晉維 \n 40923149 許倚睿 \n 40923150 許惟盛 \n 40923152 連冠勳 \n', 'tags': '', 'url': 'About.html'}, {'title': '組員', 'text': '', 'tags': '', 'url': '組員.html'}, {'title': '40923113', 'text': 'NX影片1~5 \n \n About \n \n 40923113 \n 倉儲  https://github.com/40923113/cd2022 \n CoppeliaSim \n 組裝連趕 \n 模擬coppelisime \n \n \n NX1980 \n 1.視圖控制 \n 簡單的基本操作 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 2.在NX中製作一個簡單的模型 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 3.三角形草圖 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 4.繪製階梯塊 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 5.繪製飛輪 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n note \n 建立倉儲 \n 先尋找老師倉儲的cmsimde site \xa0 \n 接著複製老師的網址 \n 點選右上角+號裡的 import a repository \n 之後將老師網址貼上到 紅框的地方 \n 籃框的部分 打cd2022(名稱) 接著回到小黑窗打上 \n cd tmp \n git clone --recurse-submodules https://github.com/40923113/cd2022.git \n cd cd2022 \n cms \n 最後複製網址就可以開啟倉儲編輯 \n', 'tags': '', 'url': '40923113.html'}, {'title': '40923130', 'text': '', 'tags': '', 'url': '40923130.html'}, {'title': 'W2', 'text': 'video6 \n \n \n \n \n \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W6', 'text': 'crtrl U \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W11', 'text': '\n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '\n \n \n 一.了解學長考研究所心得 \n 二. \n 1利用批次檔案關閉 IPv4, Proxy 自動偵測, 自行設定 IPv6 DNS 與 Proxy.\xa0 \n 2利用 Hybrid 啟動可攜系統. \n 3利用 .reg 設定 Putty session, 在 IPv6 網段, 需要包括 Proxy 與 Private key 位置. \n 4啟動可攜系統時同時開啟位於 F: 中的 NX2008 \n 三. \n 1.選擇將 NXOpen Journal 檔案儲存格式設為 Python. 設定步驟, 從最上方下拉式功能表 File -> Preferences -> User Interface -> Tools -> Journal -> Journal Language 選擇存為 Python. \n 2.在NX 上方功能表最右方的 Toolbar Options 選項設定中, 開啟 Menu 表單, 從 Menu -> Tools -> Journal 中可以選擇 Play, Record 或 Edit 功能. \n 3.利用 NXOpen Python 以遞迴方式, 從已經開啟的 uarm 機械手臂組立檔案中, 查詢各零件的物理性質, 列出各零件的體積後, 計算各零件的重量. \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'w13', 'text': '\n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w16', 'text': '1.網際 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 2.遠端控制手臂 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w16.html'}, {'title': '40923140', 'text': 'NX影片11~15 \n', 'tags': '', 'url': '40923140.html'}, {'title': '40923144', 'text': 'NX影片16~19 \n', 'tags': '', 'url': '40923144.html'}, {'title': '40923145', 'text': 'NX影片20~24 \n', 'tags': '', 'url': '40923145.html'}, {'title': '40923149', 'text': 'NX影片25~29 \n 影片25 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n \n 影片26 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '40923149.html'}, {'title': '40923150', 'text': 'NX影片30~34 \n', 'tags': '', 'url': '40923150.html'}, {'title': '40923152', 'text': 'NX影片35~38 \n \n \n', 'tags': '', 'url': '40923152.html'}, {'title': '期末考週', 'text': '小組作業 : \n \n 作業四 : \n \n \n 心得: \n 40923130 :在設定旁邊分支的時候比較麻煩，步驟和遇到的問題也很多，解決完後學到很多東西 \n 40923149 :在一開始分支的地方跟30號卡了很久，靠之前上課印象和老師網站的紀錄影片，才有東西出來 \n 40923113 : 組裝dummy時雖然上學期有學過 ，但太久沒碰只好跟組員再學一次，花了我們一些時間 \n 40923144 :在跟大家組裝期間，發現自己平常學得有點不足，這次完成後，學到很多 \n 作業五 : \n \n \n 心得 : \n 40923130 :新增Suction Pad的時候比較麻煩，其他都還好 \n 40923149 :這個作業只要把suctionpad用好就輕鬆了 \n 40923113 : 這學期得課程真的很需要組別互相合作，也比上學期在CoppeliaSim到了更深的東西，比如說吸方塊或是加入suctionPad零件等等......，受益良多。 \n 40923144 :在討論期間，試了很多方法才完成的 \n 作業六 : \n \n 40923130 :只要連接VPN後，就可以遠端控制了 \n 40923149 :最後只要把30號的VPN給我，然後連接，之後他那邊負責操控，我這邊則是遠端監控 \n 40923113 : 終於結束我覺得蠻複雜的遠端監控了，真的收穫不少 \n 40923144 :在這次的期末作業，我覺得學到遠端監控這個技術非常實用', 'tags': '', 'url': '期末考週.html'}]};